import React from 'react'
import PetCard from './PetCard'

export default function PetsList({ petsList }) {

    const list = petsList.map(pet => <PetCard
        name={petsList.name}
        race={petsList.race}
        type={petsList.type}
        location={petsList.location}
        photo={petsList.photo}
    />)


    return (
        <div>
            {list}
        </div>
    )
}
